import React, { Component } from 'react';

export default class PokemonItemOfList extends Component {
    render() {
        return (
            <div className="pure-u-1-2 center-element" key={this.props.index}>
                <img className="small-image" src={this.props.image} />
                <p>{this.props.name}</p>
            </div>
        )
    }
}
